import React from 'react';
import { CardImg, Container } from 'react-bootstrap';
import AppNavBar from '../layouts/AppNavbar';
import logo from "./../img/freely-logo-final.png";
export default function Download() {
	const gotoLinkPlay = () => {
		window.open("https://play.google.com/store/apps/details?id=com.freellyapp", "_blank");
			};

			const gotoLinkIos = () => {
				window.open("https://apps.apple.com/us/app/freelly-bikepool-carpool/id6476261777", "_blank");
					};



	return (
		<div>
			<AppNavBar/>
			<Container>
		<div style={{
			display: 'flex',
				alignItems: 'center',
				justifyContent: 'center',
		marginTop:120,

		}}>
		<CardImg
			alt="Card image cap"
			bottom
			src={logo}
			style={{
				width:"40%"
			}}
			/>
		</div>
		<div className="mt-5 mb-5 banner justify-content-center align-items-center">
			<h2>Freelly অ্যাপ ডাউনলোড করতে নিচের লিংকগুলো ভিজিট করুন </h2>
			<div className="mt-5 ">
			<button className="downloadApp-banner-play" onClick={gotoLinkPlay}></button>
			<button className="downloadApp-banner-ios" onClick={gotoLinkIos}></button>
			</div>
			</div>
			</Container>
			<Container>

		</Container>
		</div>
	)
}
